function filt(priceArr, filter, pricePrev) {
    if (priceArr.length < 2) {
        return priceArr.at(-1)
    }
    let price = priceArr.at(-1)
    //let pricePrev = priceArr.at(-2)
    let filtdev = filter * calculateStandardDeviation(priceArr)
    price = Math.abs(price - pricePrev) < filtdev ? pricePrev : price
    return price
}


function calculateStandardDeviation(array) {
    //known as stdev in tradingview
    const n = array.length
    const mean = array.reduce((a, b) => a + b) / n
    const StandDev = Math.sqrt(array.map(x => Math.pow(x - mean, 2)).reduce((a, b) => a + b) / n)
    return StandDev
}


function jurik_filt(src, len, phase, prevArray, vsumArr, avgLen) {
