    const pow1 = Math.max(len1 - 2.0, 0.5)
    let volty = 7.0, avolty = 9.0, vsum = 8.0, bsmax = 5.0, bsmin = 6.0
    let temp_avg = 0

    let del1 = src - bsmax1
    let del2 = src - bsmin1

    let div = 1.0 / (10.0 + 10.0 * (Math.min(Math.max(len - 10, 0), 100)) / 100)
    volty = Math.abs(del1) > Math.abs(del2) ? Math.abs(del1) : Math.abs(del2)
    vsum = vsum1 + div * (volty - volty10)

    vsumArr.push(vsum)
    if (vsumArr.length > avgLen) {
        vsumArr.splice(0, 1)   // keep array to size
        temp_avg = vsumArr.reduce((a, b) => (a + b)) / vsumArr.length
    }

    if (vsumArr.length <= avgLen + 1) {
        avolty = avolty1 + 2.0 * (vsum - avolty1) / (avgLen + 1)
    } else {
        avolty = temp_avg
    }


    let dVolty = avolty > 0 ? volty / avolty : 0
    dVolty = dVolty > Math.pow(len1, 1.0 / pow1) ? Math.pow(len1, 1.0 / pow1) : dVolty
    dVolty = dVolty < 1 ? 1 : dVolty
    let pow2 = Math.pow(dVolty, pow1)
    let len2 = Math.sqrt(0.5 * (len - 1)) * len1
    let Kv = Math.pow(len2 / (len2 + 1), Math.sqrt(pow2))

    bsmax = del1 > 0 ? src : src - Kv * del1
    bsmin = del2 < 0 ? src : src - Kv * del2

    let phaseRatio = phase < -100 ? 0.5 : phase > 100 ? 2.5 : phase / 100 + 1.5
    let beta = 0.45 * (len - 1) / (0.45 * (len - 1) + 2)
    let alpha = Math.pow(beta, pow2)
    let jma1 = 0.0, e0 = 0.0, e1 = 0.0, e2 = 0.0
    e0 = (1 - alpha) * src + alpha * e0_1
    e1 = (src - e0) * (1 - beta) + beta * e1_1
    e2 = (e0 + phaseRatio * e1 - jma1_1) * Math.pow(1 - alpha, 2) + Math.pow(alpha, 2) * e2_1
    jma1 = e2 + jma1_1

    returnedVals.push(jma1, bsmax, bsmin, vsum, avolty, e0, e1, e2, volty)
    //console.log("\t\tinside fn: ", returnedVals)
    return returnedVals
}

